import React from "react";
import reactDom from "react-dom";
import "./index.css";

let currdate = new Date();
currdate = currdate.getHours();




reactDom.render(<>
  <div>
    <h1>hello arun solanki <span>{currdate}</span></h1>
  </div>
</>,document.getElementById("root"));
